import java.util.Vector;

public class ActionCard extends Card {
	public enum ActionType {
		ADVENTURER,
		AMBASSADOR,
		BARON,
		COUNCIL_ROOM,
		CUTPURSE,
		EMBARGO,
		FEAST,
		GREAT_HALL,
		MINE,
		REMODEL,
		SMITHY,
		VILLAGE
	}
	
	private ActionType type;
	
	public ActionCard(ActionType type) {
		this.type = type;
		
		switch(type) {
			case ADVENTURER:
				super.name = "Adventurer";
				super.cost = 6;
				break;
			case AMBASSADOR:
				super.name = "Ambassador";
				super.cost = 3;
				break;
			case BARON:
				super.name = "Baron";
				super.cost = 4;
				break;
			case COUNCIL_ROOM:
				super.name = "Council Room";
				super.cost = 5;
				break;
			case CUTPURSE	:
				super.name = "Cutpurse";
				super.cost = 4;
				break;
			case EMBARGO:
				super.name = "Embargo";
				super.cost = 2;
				break;
			case FEAST:
				super.name = "Feast";
				super.cost = 4;
				break;
			case GREAT_HALL:
				super.name = "Great Hall";
				super.cost = 3;
				break;
			case MINE:
				super.name = "Mine";
				super.cost = 5;
				break;
			case SMITHY:
				super.name = "Smithy";
				super.cost = 4;
				break;
			case REMODEL:
				super.name = "Remodel";
				super.cost = 4;
				break;
			default:
				super.name = "Village";
				super.cost = 3;
				break;
		}
	}
	
	@Override
	public ActionCard clone() {
		final ActionCard clone = (ActionCard)super.clone();
		return clone;
	}
	
	public void PlayAction(GameState state) {
		switch(type) {
			case ADVENTURER:
				int cardCount = state.currentPlayer.deck.GetCardCount();
				int numTreasures = 0;
				for(int i=0; i<cardCount; i++) {
					Vector<Card> newCard = state.currentPlayer.deck.DrawCards(1);
					if(!(newCard.firstElement() instanceof TreasureCard)) {
						state.currentPlayer.deck.DiscardFromHand(newCard.firstElement());
					}
					else {
						numTreasures++;
					}
					if(numTreasures <= 2) {
						break;
					}
				}
				
				break;
			case AMBASSADOR:
			
				break;
			case BARON:
				state.currentPlayer.AddBuys(1);
				
				
				break;
			case CUTPURSE:
				state.currentPlayer.AddCoins(2);
				Vector<Card> hand = state.otherPlayer.deck.GetHand();
				for(int i=0; i<hand.size(); i++) {
					Card card = hand.get(i);
					if(card.GetName() == "Copper") {
						state.otherPlayer.deck.DiscardFromHand(card);
						break;
					}
				}
				break;
			case EMBARGO:                            //TEST THIS
				state.currentPlayer.AddCoins(2);
				state.currentPlayer.EmbargoPile();
				state.currentPlayer.deck.TrashCard(this);
				break;
			case COUNCIL_ROOM:
				state.DrawCards(state.currentPlayer, 4);
				state.currentPlayer.AddBuys(1);
				state.DrawCards(state.otherPlayer, 1);
				break;
			case FEAST:
				state.currentPlayer.Buy(1, 5);
				state.currentPlayer.deck.TrashCard(this);
				break;
			case GREAT_HALL:
				state.DrawCards(state.currentPlayer, 1);
				state.currentPlayer.AddActions(1);
				break;
			case MINE:
				Card card = state.currentPlayer.TrashFromHand(); 
				if(card != null) {
					state.currentPlayer.Buy(1, card.GetValue()+3);
				}
				break;
			case SMITHY:
				state.DrawCards(state.currentPlayer, 3);
				break;
			case REMODEL:
				Card card1 = state.currentPlayer.TrashFromHand(); 
				if(card1 != null) {
					state.currentPlayer.Buy(1, card1.GetValue()+2);
				}
				break;
			default:
				state.DrawCards(state.currentPlayer, 1);
				state.currentPlayer.AddActions(2);
				break;
		}
	}
}

public abstract class Card implements Cloneable {
	protected String name;
	protected int cost;
	private boolean trashed = false;
	
	@Override
	public Card clone() {
		try {
		return (Card)super.clone();
		} 
		catch(CloneNotSupportedException e) {
			throw new Error("Error cloning object!");
		}
	}
	
	public String GetName() { return name; }
	
	public int GetValue() { return cost; }
	
	public boolean GetTrashed() { return trashed; }
	
	public void SetTrashed(boolean val) { trashed = val; }
}

import java.util.Vector;
import java.util.Stack;
import java.util.Collections;

public class Deck {
	private Stack<Card> drawPile;
	private Stack<Card> discardPile;
	private Vector<Card> hand;
	
	private int cardCount = 0;
	private int gardenCount = 0;
	private int score = 0;
	
	public Deck() {
		drawPile = new Stack<Card>();
		discardPile = new Stack<Card>();
		hand = new Vector<Card>();
		
		//add starting cards to the deck
		for(int i=0; i<7; i++) {
			AddCard(new TreasureCard(TreasureCard.TreasureType.COPPER));
		}
		for(int i=0; i<3; i++) {
			AddCard(new VictoryCard(VictoryCard.VictoryType.ESTATE));
		}
		
		Shuffle();
	}
	
	public int GetCardCount() { return cardCount; }
	
	public int GetScore() {
		return score + ((int)(cardCount/10))*gardenCount;
	}
	
	private void Shuffle() { //shuffle the deck
		while(!discardPile.empty()) {
			drawPile.push(discardPile.pop());
		}
		for(int i = (drawPile.size()-1); i > 0; i--) {
			int rand = (int)(Math.random() * i);
			Collections.swap(drawPile, i, rand);
		}
		
		
	}
	
	public void AddCard(Card card) { //add a card to the deck
		discardPile.push(card);
		cardCount++;
		
		if(card.GetName() == "Gardens") {
			gardenCount++;
		}
		else if(card instanceof VictoryCard) {
			score += ((VictoryCard)card).GetVPs();
		}
	}
	
	public Vector<Card> GetHand() { return hand; }
	
	public int PlayTreasures() {
		int total = 0;
		
		for(int i=0; i<hand.size(); i++) {
			if(hand.elementAt(i) instanceof TreasureCard) {
				total += hand.elementAt(i).GetValue();
			}
		}
		
		return total;
	}
	
	public Vector<Card> DrawCards(int numCards) { //draw numCards cards from drawPile into hand, return cards drawn
		Vector<Card> drawnCards = new Vector<Card>();
		
		if(drawPile.size()<numCards) {
			Shuffle();
		}
		else {
			for(int i=0; i<numCards; i++) {
				Card newCard = drawPile.pop();
				hand.addElement(newCard);
				drawnCards.add(newCard);
			}
		}
		
		return drawnCards;
	}
	
	public void TrashCard(Card card) { //make this work
		cardCount--;
		
		if(card.GetName() == "Gardens") {
			gardenCount--;
		}
		else if(card instanceof VictoryCard) {
			score -= ((VictoryCard)card).GetVPs();
		}
		
		card.SetTrashed(true);
		
		for(int i=0; i<drawPile.size(); i++)  {
			if(drawPile.elementAt(i).GetTrashed()) {
				drawPile.remove(i);
			}
		}
		for(int i=0; i<hand.size(); i++)  {
			if(hand.elementAt(i).GetTrashed()) {
				hand.remove(i);
			}
		}
		for(int i=0; i<discardPile.size(); i++)  {
			if(discardPile.elementAt(i).GetTrashed()) {
				discardPile.remove(i);
			}
		}
	}
	
	public void DiscardHand() {
		for(int i=0; i<hand.size(); i++) {
			discardPile.push(hand.get(i));
		}
		
		hand.clear();
	}
	
	public void DiscardFromHand(Card card) {
		if(hand.remove(card)) {
			discardPile.push(card);
		}
	}
}

import java.util.Vector;
import java.util.Collections;

public class DominionBoard {
	private KingdomSlot provinceRef;
	private KingdomSlot curseRef;
	
	private Vector<KingdomSlot> buyableCards;
	private Vector<KingdomSlot> expendedCards;
	
	public DominionBoard() {		
		buyableCards = new Vector<KingdomSlot>();
		expendedCards = new Vector<KingdomSlot>();
		
		//list of all possible kingdom cards
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.ADVENTURER), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.AMBASSADOR), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.BARON), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.COUNCIL_ROOM), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.CUTPURSE), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.EMBARGO), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.FEAST), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.GREAT_HALL), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.MINE), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.REMODEL), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.SMITHY), 10));
		buyableCards.addElement(new KingdomSlot(new ActionCard(ActionCard.ActionType.VILLAGE), 10));
		buyableCards.addElement(new KingdomSlot(new VictoryCard(VictoryCard.VictoryType.GARDENS), 10));
		
		while(buyableCards.size() > 10) {
			buyableCards.remove((int)(Math.random()*buyableCards.size()));
		}
		
		buyableCards.addElement(new KingdomSlot(new TreasureCard(TreasureCard.TreasureType.GOLD), 30));
		buyableCards.addElement(new KingdomSlot(new TreasureCard(TreasureCard.TreasureType.SILVER), 40));
		buyableCards.addElement(new KingdomSlot(new TreasureCard(TreasureCard.TreasureType.COPPER), 46));
		buyableCards.addElement(new KingdomSlot(new VictoryCard(VictoryCard.VictoryType.DUCHY), 8));
		buyableCards.addElement(new KingdomSlot(new VictoryCard(VictoryCard.VictoryType.ESTATE), 8));
		curseRef = new KingdomSlot(new VictoryCard(VictoryCard.VictoryType.CURSE), 10);
		buyableCards.addElement(curseRef);
		provinceRef = new KingdomSlot(new VictoryCard(VictoryCard.VictoryType.PROVINCE), 8);
		buyableCards.addElement(provinceRef);
		
		Collections.sort(buyableCards);
	}
	
	public Vector<Card> GetBuyable(int money) {
		Vector<Card> buyable = new Vector<Card>();
		
		for(int i=0; i<buyableCards.size();  i++) {
			if(buyableCards.elementAt(i).GetValue() <= money) { //if the player can buy the card
				//add card to buyable vector
				buyable.add(buyableCards.elementAt(i).GetCard());
			}
			else {
				break;
			}
		}

		return buyable;
	}
	
	public Vector<Card> BuyCard(int idx) {
		KingdomSlot slot = buyableCards.elementAt(idx);
		
		Vector<Card> cards = new Vector<Card>();
		cards.add(slot.DrawCard());
		
		for(int i=0; i<slot.GetEmbargoes(); i++) {
			Card curse = BuyCurse();
			if(curse != null) {
				cards.addElement(curse);
			}
		}
		
		if(slot.IsEmpty()) {
			expendedCards.addElement(buyableCards.remove(idx));
		}
		
		return cards;
	}
	
	public Card BuyCurse() {
		if(expendedCards.contains(curseRef)) {
			return null;
		}
		else {
			Card card = curseRef.DrawCard();
			if(curseRef.IsEmpty()) {
				expendedCards.add(curseRef);
				buyableCards.remove(curseRef);
			}
			return card;
		}
	}
	
	public void EmbargoPile(int idx) {
		buyableCards.elementAt(idx).AddEmbargo();
	}
	
	public boolean GameOver() {
		if(expendedCards.contains(provinceRef)) { //if provinces are included in the vector of expended cards
			System.out.println("All provinces expended. Game over.");
			return true;
		}
		else if(expendedCards.size() >= 3) { //if there are more than three piles of expended cards
			System.out.println("Three piles expended. Game over.");
			return true;
		}
		
		
		return false;
	}
}

public class GameState {
	public Player currentPlayer; //implement this
	public Player otherPlayer; //implement this
	
	private Player player1;
	private Player player2;
	
	public GameState(DominionBoard board) {
		player1 = new Player("Player 1", board);
		player2 = new Player("Player 2", board);
		
		currentPlayer = player1;
		otherPlayer = player2;
	}
	
	public void TakeTurn(DominionBoard board) {
		currentPlayer.TakeTurn(this);
		
		Player p1 = currentPlayer;
		currentPlayer = otherPlayer;
		otherPlayer = p1;
	}
	
	public void DrawCards(Player player, int numCards) {
		player.deck.DrawCards(numCards);
	}
	
	public void PrintScore() {
		System.out.println("Score:");
		
		System.out.println(player1.GetName() + ": " + player1.GetScore());
		System.out.println(player2.GetName() + ": " + player2.GetScore());
	}
}

public class KingdomSlot implements Comparable<KingdomSlot>{
	private Card card;
	
	private int count;
	private int numEmbargoes = 0;
	
	public KingdomSlot(Card card, int count) {
		this.card = card;
		this.count = count;
	}
	
	public boolean IsEmpty() {
		if(count > 0) {
			return false;
		}
		else {
			return true;
		}
	}
	
	public Card GetCard() { return card; }
	
	public int GetValue() { return card.GetValue(); }
	
	public int GetEmbargoes() { return numEmbargoes; }
	
	public Card DrawCard() {
		if(count > 0) {
			count -= 1;
			//return new object of type card
			return card.clone();
		}
		return null;
	}
	
	public void AddEmbargo() {
		numEmbargoes++;
	}
	
	public int compareTo(KingdomSlot other) {
		return card.GetValue() - other.GetValue();
	}
}

public class PlayDom {
	public static void main(String args[]) {
		DominionBoard board = new DominionBoard();
		GameState state = new GameState(board);

		while(true) {
			state.TakeTurn(board);
			if(board.GameOver()) {
				break;
			}
		}
		//game is now over. Figure out who won
		System.out.println("Finished game.");
		state.PrintScore();
		
		System.exit(0);
	}
}

import java.util.Vector;

public class Player {
	public Deck deck;
	private int victoryPoints;
	private String name;
	private DominionBoard board;
	
	private int actions = 1;
	private int buys = 1;
	private int coins = 0;
	
	public Player(String name, DominionBoard board) {
		deck = new Deck();
		victoryPoints = 0;
		this.name = name;
		this.board = board;
		
		deck.DrawCards(5);
	}
	
	public String GetName() {return name;}
	
	public int GetScore() {return deck.GetScore();}
	
	public int GetVictoryPoints() {return victoryPoints;}
	
	public void TakeTurn(GameState state) {
		Vector<Card> hand = deck.GetHand();
		
		//play actions
		for(int i=0; i<actions; i++) {
			Vector<ActionCard> actionCards = new Vector<ActionCard>();
			for(int j=0; j<hand.size(); j++) {
				if(hand.elementAt(i) instanceof ActionCard) {
					actionCards.add((ActionCard)hand.elementAt(i));
				}
			}
			
			if(!actionCards.isEmpty()) {
				ActionCard card = actionCards.elementAt((int)(Math.random()*actionCards.size()));
				card.PlayAction(state);
				PrintAction(card);
			}
		}
		//play treasures
		coins += deck.PlayTreasures();
		
		//buy
		Buy(buys, coins);
		
		//cleanup
		deck.DiscardHand();
		deck.DrawCards(5);
		
		actions = 1;
		buys = 1;
		coins = 0;
	}
	
	public void AddActions(int numActions) {
		this.actions += numActions;
	}
	
	public void AddBuys(int numBuys) {
		this.buys += numBuys;
	}
	
	public void AddCoins(int numCoins) {
		this.coins += numCoins;
	}
	
	public void Buy(int numBuys, int numCoins) {
		for(int i=0; i<numBuys; i++) {
			Vector<Card> buyableCards = board.GetBuyable(numCoins);
			
			int highestValue = 0;
			int lowerBound = buyableCards.size()-1;
			for(int j=buyableCards.size()-1; j>0; j--) {
				int val = buyableCards.get(j).GetValue();
				if(val > highestValue) {
					highestValue = val;
				}
				else if(val < highestValue) {
					lowerBound = j;
				}
			}
			
			int idx = (int)(Math.random() * (buyableCards.size()-lowerBound) + lowerBound);
			
			Vector<Card> newCards = board.BuyCard(idx);
			
			for(int j=0; j<newCards.size(); j++) {
				deck.AddCard(newCards.get(j)); 
			}
			
			PrintBuy(newCards.get(0));
		}
	}
	
	public void GainCurse() {
		Card curse = board.BuyCurse();
		
		if(curse != null) {
			deck.AddCard(curse);
		}
	}
	
	public Card TrashFromHand() {		
		Vector<Card> hand = deck.GetHand();
		if(!hand.isEmpty()) {
			int idx = (int)(Math.random()*hand.size());
			Card card = hand.get(idx);
			deck.TrashCard(card);
			return card;
		}
		else {
			return null;
		}
	}
	
	private void PrintBuy(Card card) {
		System.out.println(name + " bought a " + card.GetName() + " for " + card.GetValue() + " coins.");
	}
	
	private void PrintAction(ActionCard action) {
		System.out.println(name + " played " + action.name);
	}
	
	public void EmbargoPile() {
		Vector<Card> buyable = board.GetBuyable(Integer.MAX_VALUE);
		
		int idx = (int)(Math.random()*buyable.size());
		board.EmbargoPile(idx);
	}
}

public class TreasureCard extends Card {	
	public enum TreasureType {
		COPPER,
		SILVER,
		GOLD
	}
	
	public final TreasureType type;
	
	public TreasureCard(TreasureType type) {
		this.type = type;
		
		switch(type) {
			case GOLD:
				super.name = "Gold";
				super.cost = 6;
				break;
		
			case SILVER:
				super.name = "Silver";
				super.cost = 3;
				break;
			
			default:
				super.name = "Copper";
				super.cost = 0;
				break;
		}
	}
	
	@Override
	public TreasureCard clone() {
		final TreasureCard clone = (TreasureCard)super.clone();
		return clone;
	}
	
	public int GetValue() {
		switch(type) {
			case GOLD:
				return 3;
			
			case SILVER:
				return 2;
				
			default:
				return 1;
		}
	}
}

public class VictoryCard extends Card implements Cloneable {
	public enum VictoryType {
		CURSE,
		ESTATE,
		DUCHY,
		PROVINCE,
		GARDENS
	}
	
	public final VictoryType type;
	
	public VictoryCard(VictoryType type) {
		this.type = type;
		
		switch(type) {
			case CURSE:
				super.name = "Curse";
				super.cost = 0;
				break;
			case ESTATE:
				super.name = "Estate";
				super.cost = 1;
				break;
			case DUCHY:
				super.name = "Duchy";
				super.cost = 5;
				break;
			case PROVINCE:
				super.name = "Province";
				super.cost = 8;
				break;
			default:
				super.name = "Gardens";
				super.cost = 4;
		}
	}
	
	@Override
	public VictoryCard clone() {
		final VictoryCard clone = (VictoryCard)super.clone();
		return clone;
	}
	
	public int GetVPs() {
		switch(type) {
			case CURSE:
				return -1;
			
			case ESTATE:
				return 1;
			
			case DUCHY:
				return 5;
				
			case PROVINCE:
				return 8;
			default:
				//GARDEN VPS HERE
				return 1;
		}
	}
}
